import React, { Component } from "react";
import TodoContainer from "./containerComponents/TodoContainer";
import TaskInputField from "./textComponents/TaskInputField";

const style = {
  container: {
    height: "100vh",
    width: "100%",
    display: "flex",
    justifyContent: "center",
    alignItems: "center"
  }
};

export const Main = () => {
  return (
    <div style={style.container}>
      <div style={style.container}>
        <TodoContainer />
      </div>
      <div style={style.container}>
        <TaskInputField text={"Please enter your task description"} />
      </div>
    </div>
  );
};

export default Main;
